import styled from "styled-components";

const SearchUserStyled = styled.div`
  display: flex;
  flex-direction: column;
  width: 86.25em;
  flex-wrap: wrap;
  padding-left: 1em;
  min-height: 4em;
  border-bottom: 1px solid #ccc;
`;

export default SearchUserStyled;
